   })

     return   (



       <div class="h-[42rem]   brightness-105 drop-shadow bg-center-top  ..."  style={{backgroundImage: `url(${homebg})`}}     >

         <div class="h-[30rem] w-[50rem] bg-none">

         <img class="  pt-[18rem]  mb-[1rem]  flex justify-center ml-[3rem]" src={raisebywolf} alt="" />     
