         <button class=" ml-[3rem] -mt-[0.1rem] w-[10rem] h-11 rounded-3xl text-bt-text text-xl..." style={{background: "linear-gradient(90deg, rgb(71, 16, 193), rgb(120, 87, 255) 92%, rgb(129, 155, 253) 100%)" }}    >SIGN UP NOW</button>

         </div>



      </div>






     )



}
